import Header from './Header';
import Footer from './Footer';
import Navigation from './Navigation';

export default ({ children, pageData }) => (
    <div>
        <Header {...pageData}></Header>
        <Navigation></Navigation>
        {children}
        <Footer></Footer>
    </div>
);
